import React from 'react'
import styled from "styled-components";


const Error = () => {
    return (
        <Wrapper>
            <div>
                <h1>404</h1>
                <h3>Error 404 - Page not found.</h3>
            </div>           
        </Wrapper>
    )
}

// *** Styles ***
const Wrapper = styled.section`
   background-color: red;
`;


export default Error
